import React, { useEffect } from "react";
import "./Rules.css"; // för rules-container och text-break

function Gallery() {
  useEffect(() => {
    // Lägg bara till skriptet om det inte redan finns
    if (!document.getElementById("elfsight-script")) {
      const script = document.createElement("script");
      script.id = "elfsight-script";
      script.src = "https://elfsightcdn.com/platform.js";
      script.async = true;
      document.body.appendChild(script);
    }
  }, []);

  return (
    <div style={{ padding: "20px" }}>
      <h1>Galleri</h1>
      <div className="rules-container text-break" style={{ padding: "20px" }}>
        <p>Här kan du se de senaste inläggen från vårt Instagram-konto:</p>
        
        {/* Instagram-widget */}
        <div
          class="elfsight-app-8572ff3f-df8a-48c3-af33-b46265359cbd"
          data-elfsight-app-lazy
        ></div>
      </div>
    </div>
  );
}

export default Gallery;
